import React from 'react'

const Categories = ({ items, filterItems }) => {
  const [id, category] = items

  return (
    <div className="btn-container">
      <button
        key={id}
        className="filter-btn"
        onClick={() => {
          filterItems('breakfast')
        }}
      >
        {{ category }}
      </button>
    </div>
  )
}

export default Categories
